This was a message I got today after one of my stories. 

Being an entrepreneur for 7 years has given me thick skin and I thankful don’t let other’s misunderstandings bother me. 

This one didn’t bother me, but I do feel the need to educate as there are so many stigmas around mental illnesses. 

Unfortunately those who’ve never dealt with anxiety are under the impression that it’s a mental thing and those with it can just “snap out of it.” 

Which couldn’t be the farthest from the truth. 

I’m pretty damn mentally strong, so if that were the case, I wouldn’t have dealt with it for 4+ years and possibly will live with it for life. 

Yes, we did just go on the most magical vacation and I AM happy, but I’m also anxious and extremely tired. 

The last few months have been mentally challenging for me with the kids home for 6 months. 

With proper exercises mentally and physically and a lot of self awareness - It’s going to take me some time to adjust back and feel more myself - motivated, energized and calm. 

For those that don’t understand anxiety, I’m an open book, I’d love to answer questions for you to better understand it. 

I love you, but don’t judge me ✌️";}i:147;a:1:{s:14:"comments_count";i:4;}i:148;a:1:{s:11:"likes_count";i:20;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvBlLygqkO";}i:150;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118926348_771108430350555_8480432325969742606_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=m3WvwPTVwwMAX8EbxJD&oh=9da501d07445f2230f2c1c2183fa3bae&oe=5F7CBA13";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:184291251;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391135332265340377";}i:157;a:1:{s:10:"short_code";s:11:"CEvBOp5j63Z";}i:158;a:1:{s:12:"created_time";i:1599265565;}i:159;a:1:{s:7:"caption";s:1015:"Posted @withregram • @wingsofstrength Join us for another exciting episode of FEMME FLEX FRIDAY, the Female Bodybuilding, Fitness & Health Talk Show!  Hosts Alina Popa & Lenda Murray give you an inside look into the world of female bodybuilding, next level athletes as well as all things related to women's Health & fitness.  On this episode, 8x Ms. Fitness Olympia Adela Garcia shares her story of finding her passion on the Olympia stage and what it takes to get there.  

